import * as React from 'react';
import store from '../store/store';
import { connect } from 'react-redux';

function BoxList(props:any) {

    function createBox(R:number, G:number, B:number){
        const style = { ["backgroundColor" as any]: `rgb:(${R}, ${G}, ${B})` } as React.CSSProperties;
        return (<div style={style} className="box"></div>)
    }
    let showList: JSX.Element[] = [];
    props.map((box: { R: number; G: number; B:number; }) => {
        showList.push(createBox(box.R, box.G, box.B));
        return 0;
    })

    console.log("showList:" + showList);
    return (
        <div className='box-list'>
            {showList}
        </div>
     );
}

function mapStateToProps(state:any){
    return {
        list: state
    }
}

export default BoxList;
